var mainTable;$(function(){mainTable=$("#mainTable").DataTable({serverSide:!0,searchDelay:500,lengthMenu:[5,10,25],ajax:{url:"/api/admin/users"},columns:[{data:"id"},{data:"username"},{data:"email"},{data:"status",orderable:!1},{data:"roles",orderable:!1},{width:120,orderable:!1,render:function(n,t,i){return'<a class="btn btn-sm btn-primary mr-2" href="/admin/user/Save/'+i.id+'">Edit<\/a><button class="delBtn btn btn-sm btn-secondary" type="button" data-id="'+i.id+'">Delete<\/button>'}}],order:[[0,"DESC"]]});$("#mainTable").on("click",".delBtn",function(){var n=$(this);bootbox.confirm("Delete user?",function(t){if(t){var i=n.data("id");axios.delete("/api/admin/user/"+i).then(function(n){var t=n.data;$.isSuccess(t)?window.location="/admin/user":bootbox.alert(t)})}})})});